  false,\n\t\"url\": null,\n\t\"notes\": \"This submission is part of an inventory
  of People's Republic of Chinan(PRC) historical data and data from the first PRC/US
  Toga cruise. Thenship used was the XIANGYANGHONG 14. The format for the data is
  includednin the documentation. Three sets of data are contained in thisninventory.
  First set contains dissolved oxygen and ph value data fromnthe cruise in January
  1986 and the data were collected by the FirstnInstitute of Oceanography, PRC in
  the Tropical Western Pacific. Thensecond set contains marine meteorology data from
  the cruise fromnDecember 1985 to February 1986. The data were collected in the TropicalnWestern
  Pacific on the XIANGYANGHONG 14 by the South Sea Branch of thenState Oceanic Administration,
  PRC. Parameters included in this file are:nin situ atmospheric pressure; wind speed
  and direction; sea surface; airnand dew-point temperature; absolute and relative
  humidity; as well asncloud, wind and wave parameters. The third set contains chlorophyll
  andnassociated data from the Toga cruise December 1985 to February 1986.nThis file
  includes the following parameters salinity, temperature,ndepth, nutrients, chlorophyll,
  phaeophytin values, carbon fixation andnproductivity index.\",\n\t\"owner_org\":
